import React from "react";
import './about.css'
  
const About = () => {
  return (
    <div>
      <h1 className="aboutheader">
        This is a Store Website project designed to allow a user to add and checkout items into a cart to order them.
      </h1>
      <h1 className="aboutheader">  It was made using React.js and Node.js.
      </h1>
    </div>
  );
};
  
export default About;
